{% extends "base.html" %}
{% block content %}
<h1>404 - Not found</h1>
<script>
    (function () {
        var path = window.location.pathname;
        if (/\/machine-learning-interview-qa\/questions\/[0-9]{1,2}\.html/.test(path)) {
            window.location.href = path.replace('/questions/', '/').replace('.html', '/');
        }
        if (/\/stackoverflow-python-top-qa\/stackoverflow\/[0-9]{1,2}\..+\.html/.test(path)) {
            var question = '.' + path.split('.')[1] + '.html';
            window.location.href = path.replace('/stackoverflow/', '/').replace(question, '/');
        }
    })();
</script>
